import { useMeQuery } from "../../generated/graphql"


export const checkAuth = (authCallback: (isAuth: boolean) => void) => {

    const {data, error} = useMeQuery()

    if(data && data.me?.email){
        authCallback(true)
    }

    if(error) {
        authCallback(false)
    }
}
